s son requeridos -->\n\n<!-- Fields -->\n  Client = snowflake, mencion, usertag\n  prefix = prefix del bot <!-- Menos de 5 caracteres -->\n  descripcion = una breve descripcion de tu bot\n```\n\n> La informacion de los bots (tag, username y avatar) se actualiza automaticamente aprox cada 30s, esto genera bastante lag en el bot, ya buscaremos una solucion.\n> La web es la misma de antes ___[https://lappland.kaedestudio.ga/app]___ y esta incluye barra de busqueda\n\n**Cosas a tener en cuenta**\n- Los bots aun no se ordenan por numero de votos, quizas mas tarde llegue\n- La opcion de votar (dentro de la web) esta deshabilitada, es su lugar use `??vote <Snowflake>` una vez sea lanzada la v5 de <@!890016209007960145> \n- Aun no se hace el OAuth2\n- La pagina no es open source (archivos como server.js y todo lo que esta dentro de `src` no puede ser copiado)\n- No hare ping esta vez\n\n||Agradezco a los q tiraron ideas tanto para esta version como para la anterior, seran implementadas con el timepo||"},{"type":"edited","author":"788869971073040454","content":"<a:glitters:834999102294065163> **Vuelve la botlist** <a:glitters:834999102294065163> \n> Efectivamente, la botlist ya esta activa de nuevo, para agregar su bot use \n```xml\n<!-- Commando (lappland) -->\n??add-bot <Client> ?? <Prefix> ?? <Descripcion>\n              <!-- ^^ Estos son requeridos -->\n\n<!-- Fields -->\n  Client = snowflake, mencion, usertag\n  prefix = prefix del bot <!-- Menos de 5 caracteres -->\n  descripcion = una breve descripcion de tu bot\n```\n\n> La informacion de los bots (tag, username y avatar) se actualiza automaticamente aprox cada 30s, esto genera bastante lag en el bot, ya buscaremos una solucion.\n> La web es la misma de antes ___[https://lappland.kaedestudio.ga/app]___ y esta incluye barra de busqueda\n\n**Cosas a tener en cuenta**\n- Los bots aun no se ordenan por numero de votos, quizas mas tarde llegue\n- La opcion de votar (dentro de la web) esta deshabilitada, es su lugar use `?