const booru = require('booru');\nconst { MessageEmbed } = require('discord.js');\nconst trimString = (str, max) => ((str.length > max) ? `${str.slice(0, max - 3)}...` : str);\n\nmodule.exports = {\n  name: 'rule-34',\n  alias: ['r34', 'rule34'],\n  category: 'nsfw',\n  run: async (client, message, args) => {\n    if (message.channel.nsfw === false) {\n      message.reply({ content: '❌ Solo canales **__NSFW__**' })\n    } else if (!args[0]) {\n      message.reply({ content: '❌ Escribe algo para buscar.' })\n    } else {\n      booru.search('rule34.xxx', args[0], {limit: 3, random: true})\n        .then(booru.commonfy)\n        .then(images => {\n          for (let image of images) {\n            if (image.common.file_url === null) {\n              message.reply({ content: '❌ No se encontraron resultados.' })\n            } else {\n              let r34t = trimString(`${image.common.tags}`, 256);\n              \n              const r34Embed = new MessageEmbed()\n                .setDescription(`**⏫  :: Score: ${image.common.score}** \\n**🌟  :: Rating: ${image.common.rating}** \\n**🏷️  :: Tags: \\n\\`\\`\\`\\n${r34t}\\`\\`\\`**`)\n                .setImage(image.common.file_url)\n                .setColor('#CF3476')\n\n              message.channel.send({ embeds: [r34Embed] })\n            }\n          }\n        })\n        .catch(err => {\n          if (err.name === 'BooruError') {\n            console.log(err.message)\n            message.reply({ content: '❌ Ha ocurrido un error.'})\n          } else {\n            console.log(err)\n            message.reply({ content: '❌ Ha ocurrido un error.' })\n          }\n        })\n    }\n  }\n}\n```\n\nPreview: [Click aqui uwu](https://media.discordapp.net/attachments/893592430149005382/907157324353908746/20211108_003914.jpg)"},{"type":"deleted","author":"728828371383091200","content":"v/addwiki djs *nota 2.0: El bot enviara 3 embeds con el resultado de el r34, puedes cambiar el numero de embeds desde el `booru.search`*"},