etext[$replacetext[$checkcondition[$message==];true;Sin razon :(.];false;$message]}{color:RANDOM}{timestamp:ms};yes]`\n}),({\nname: \"$alwaysExecute\",\ncode: `$setUserVar[afk;no]\n$setUserVar[afktime;]\n$setUserVar[afkmentions;0]\n$setUservar[afkr;]\n$reply[$messageID;{author:$usertag:$authoravatar}{description:$username ya no esta afk!\n> Razon: $getuservar[afkr]\n> tienes Menciones: $getUserVar[afkmentions]\n> estubiste Tiempo afk: $parseDate[$sub[$datestamp;$getUserVar[afktime]];time]}{color:RANDOM}{timestamp:ms};yes]\n\n$onlyif[$checkcontains[$message;$getservervar[prefix]afk]==false;]\n\n$onlyIf[$getuservar[afk]==si;]\n`\n}),({\nname: \"$alwaysExecute\",\ncode: `\n$setuserVar[afkmentions;$sum[$getuservar[afkmentions;$mentioned[1]];1];$mentioned[1]]\n\n$reply[$messageID;{author:$usertag:$authoravatar}{description: <@$authorid>!, $usertag[$mentioned[1]] esta afk.\n> Desde hace: $parseDate[$sub[$datestamp;$getUserVar[afktime;$mentioned[1]]];time]\n> Razón: $getuservar[afkr;$mentioned[1]]}{color:RED};yes]\n\n$onlyif[$getuservar[afk;$mentioned[1]]==si;]\n\n$onlyif[$mentioned[1]!=;]\n`\n})]"},{"type":"deleted","author":"733592358133825546","content":"<@!840337337032114176> borra mi wiki pls q la envié mal"},{"type":"deleted","author":"733592358133825546","content":"v/addwiki aoi SE ME OLVIDÓ , VARIABLES\n\nafk: \"no\",\nafkr: \"\",\nafktime: \"\",\nafkmentions: \"0\",\nAFK:\"OFF\","},{"type":"deleted","author":"884940367957467176","content":"undefined"},{"type":"deleted","author":"899644009381785601","content":"v/addwiki aoi"},{"type":"deleted","author":"884940367957467176","content":"escribe una wiki!"},{"type":"deleted","author":"899644009381785601","content":"v/addwiki aoi \n\n\navatar a"},{"type":"deleted","author":"884940367957467176","content":"undefined"},{"type":"deleted","author":"899644009381785601","content":"v/addwiki    aoi \n\navatar \n\nconst avatarCmd = {\n    name: \"avatar\",\n    aliases: [\"av\", \"icon\"],\n    code: `\n$title[$nickname[$get[id]] Icon]\n$image[$userAvatar[$get[id]]]\n$color[#ff6060]\n\n$onlyIf[$get[id]!=undefined;\\`\\`\\`js\n\"$message\" <- Id no valida\\`\\`\\`]\n\n$if[$message!=]\n$let[id;$findUser[$message;no]]\n$else\n$let[id;$authorID]\n$endif\n$cooldown[10s;espera %time%]`\n}\n\nmodule.exports = avatarCmd"},{"type":"deleted","author":"884940367957467176","content":"undefined"},{"type":"deleted","author":"884940367957467176","content":"undefined"},{"type":"deleted","author":"884940367957467176","content":"undefined"},{"type":"deleted","author":"899644009381785601","content":"v/addwiki     aoi \n\nel codigo que puse solo funciona en la vercion 4.6.0 para abajo creo"},{"type":"deleted","author":"884940367957467176","content":"undefined"},{"type":"deleted","author":"788869971073040454","content":"v/addwiki dbdts **$pushObjectProperty[key;value]**\n```\nconst func = {\n\tname: '$pushObjectValue',\n\tdescription: 'Add a value to a property',\n\tbrackets: true,\n\texecute: async (d, fn) => {\n\t\tconst [property, value] = await fn.resolveArray(d)\n\t\ttry {\n\n\t\t\tif (typeof d.object[property] != 'object') {\n\t\t\t\tif (d.object[property]) {\n\t\t\t\t\td.object[property] = Array(d.object[property])\n\t\t\t\t\td.object[property].push(value)\n\t\t\t\t} else d.object[property] = Array(value)\n\t\t\t} else {\n\t\t\t\tif (d.object[property]) {\n\t\t\t\t\td.object[property].push(value)\n\t\t\t\t} else d.object[property] = Array(value)\n\t\t\t}\n\n\t\t} catch {\n\t\t\treturn d.container.sendError(fn, `❌ Failed to push \\`${value}\\``)\n\t\t}\n\n\t\treturn fn.resolve()\n\t},\n\tfields: [\n\t\t{\n\t\t\tname: 'property',\n\t\t\trequired: true,\n\t\t\ttype: 'STRING'\n\t\t},\n\t\t{\n\t\t\tname: 'value',\n\t\t\trequired: true,\n\t\t\ttype: ['STRING', 'NUMBER']\n\t\t}\n\t]\n}\nmodule.exports = func\n```"},{"type":"deleted","author":"884940367957467176","content":"undefined"},{"type":"deleted","author":"763548180679229451","content":"v/addwiki djs a"},{"type":"deleted","author":"884940367957467176","c